import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getVisions } from "../../actions/visions";
export class Visions extends Component {
  static propTypes = {
    visions: PropTypes.array.isRequired
  };

  componentDidMount() {
    this.props.getVisions();
  }
  render() {
    return (
      <Fragment>
        <h2>Vision</h2>
        <table className="table table-stripped">
          <thea>
            <tr>
              <th>ID</th>
              <th>MISSION</th>
              <th>GOAL</th>
              <th>OUTCOME</th>
            </tr>
          </thea>
        </table>
      </Fragment>
    );
  }
}

const mapStateToProps = state => ({
  visions: state.visions.visions
});
export default connect(mapStateToProps, { getVisions })(Visions);
